import React from 'react';
import Home from "./components/Home"
import AboutMe from "./components/AboutMe"
import Portfolio from "./components/Portfolio"
import Contact from "./components/Contact"
import './App.css';
import {TransitionGroup, CSSTransition} from "react-transition-group"

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from "react-router-dom";
import Slider from './components/Portfolio';

function App() {
  return (
    <div className="App">
      <div className="links">
        <nav>
          <NavLink
            exact
            to={'/'}
            activeClassName={"active"}
          >
            Home
            </NavLink>
          <NavLink
            exact
            to={'/teamInfo'}
            activeClassName={"active"}
          >
            Team Info
          </NavLink>
          <NavLink
            exact
            to={'/leagueInfo'}
            activeClassName={"active"}
          >
            League Info
          </NavLink>
          <NavLink
            exact
            to={'/playerInfo'}
            activeClassName={"active"}
          >
            Player Info
          </NavLink>
          <NavLink
            exact
            to={'/highlights'}
            activeClassName={"active"}
          >
            Highlights
          </NavLink>
        </nav>
      </div>
      <main>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/teamInfo" component={TeamInfoPage} />
          <Route path="/leagueInfo" component={LeagueInfoPage} />
          <Route path="/playerInfo" component={PlayerInfoPage} />
          <Route path="/highlights" component={HighlightsPage} />
        </Switch>
      </main>
    </div>
  )
}
